import React from 'react';
import classes from "./Contact.module.css";
import { SiLinkedin, ImGithub, SiHackerrank } from 'react-icons/fa';

const handleURL=(url) =>{
    return() =>
         window.open(url,"_blank");
}
const Contact = () =>{
    return(
        <>
        <div className={classes.Contact}>
         <div className={classes.ContactIcons}>
             <SiLinkedin color='white' size='130px' style={{padding:'1%'}} onClick={handleURL('https://www.linkedin.com/in/ritik-ahlawat-28b1371ab/')}></SiLinkedin>
             <ImGithub color='white' size='130px' style={{padding:'1%'}} onClick={handleURL('https://github.com/ritik1234')}></ImGithub>
             <SiHackerrank color='white' size='130px' style={{padding:'1%'}} onClick={handleURL('https://www.hackerrank.com/ritikahlawat08')}></SiHackerrank>
         </div>
        </div> 
        </>
    );
}

export default Contact;
